import os
import random
from tqdm import tqdm
import numpy as np
import matplotlib.pyplot as plt
import tensorflow as tf
from tensorflow.keras.models import Model
import cv2

dataset_path = './blur-dataset'

IN = './blur-dataset/defocused_blurred'
OUT = './blur-dataset/sharp'

def data_load(path):
    result = []
    for file in tqdm(sorted(os.listdir(path))):
        if any(extension in file for extension in ['.jpg', 'jpeg', '.png']):
            image = tf.keras.preprocessing.image.load_img(path + '/' + file, target_size=(224,224))
            image = tf.keras.preprocessing.image.img_to_array(image).astype('float32') / 255
            result.append(image)
    return np.array(result)

input_images = data_load(IN)
output_images = data_load(OUT)

from sklearn.model_selection import train_test_split

# Split the preprocessed data into training and validation sets
x_train, x_test, y_train, y_test= train_test_split(input_images, output_images, test_size=0.1, random_state=42)
x_train.shape, x_test.shape, y_train.shape, y_test.shape

r = random.randint(0, len(input_images)-1)

fig = plt.figure(figsize=(10,4))
plt.suptitle(f'Image Index {r}')
ax = fig.add_subplot(1, 2, 1)
ax.imshow(input_images[r])
ax = fig.add_subplot(1, 2, 2)
ax.imshow(output_images[r])

# Network Parameters
input_shape = (224, 224, 3)
batch_size = 32

import tensorflow as tf
from tensorflow.keras import losses, Sequential, Input
from tensorflow.keras.layers import Flatten, Dense, Reshape, Conv2DTranspose, Conv2D, LeakyReLU
from tensorflow.keras.datasets import mnist
from tensorflow.keras.models import Model
from sklearn.model_selection import train_test_split
from sklearn.metrics import mean_squared_error
from keras import backend as K


model = Sequential([
    Input(shape=input_shape),
    Conv2D(64, kernel_size=(3, 3), strides=1, padding='same', activation=LeakyReLU()),
    Conv2D(128, kernel_size=(3, 3), padding='same', activation=LeakyReLU()),
    Conv2D(256, kernel_size=(3, 3), strides=1, padding='same', activation=LeakyReLU()),
    Conv2DTranspose(256, kernel_size=(3, 3), strides=1, padding='same', activation=LeakyReLU()),
    Conv2DTranspose(128, kernel_size=(3, 3), strides=1, padding='same', activation=LeakyReLU()),
    Conv2DTranspose(64, kernel_size=(3, 3), strides=1, padding='same', activation="relu"),
    Conv2DTranspose(32, kernel_size=(3, 3), strides=1, padding='same', activation="sigmoid"),
    Conv2DTranspose(3, kernel_size=(3, 3), strides=1, padding='same', activation="sigmoid"),
])

# Print the model summary
model.summary()

def SSIMLoss(y_true, y_pred):
    return 1 - tf.reduce_mean(tf.image.ssim(y_true, y_pred, 1.0))

def PSNR(y_true, y_pred):
    max_pixel = 1.0
    return (10.0 * K.log((max_pixel ** 2) / (K.mean(K.square(y_pred - y_true), axis=-1)))) / 2.303

"""![image.png](data:image/png;base64,)"""

from keras.callbacks import ReduceLROnPlateau

model.compile(loss='mse', optimizer='adam',metrics=["acc", SSIMLoss, PSNR])
lr_reducer = ReduceLROnPlateau(factor=np.sqrt(0.1),
                               cooldown=0,
                               patience=5,
                               verbose=1)
callbacks = [lr_reducer]
history = model.fit(x_train,
                      y_train,
                      validation_split=0.2,
                      epochs=70,
                      batch_size=batch_size,
                      callbacks=callbacks)

history.history.keys()

import random

print("\n       Input                        Ground Truth                  Predicted Value")
for i in range(3):
    r = random.randint(0, len(x_test)-1)
    x, y = x_train[r],y_train[r]
    x_inp=x.reshape(1,224,224,3)
    result = model.predict(x_inp)
    result = result.reshape(224,224,3)
    fig = plt.figure(figsize=(12,10))
    fig.subplots_adjust(hspace=0.1, wspace=0.2)

    ax = fig.add_subplot(1, 3, 1)
    ax.imshow(x)
    ax = fig.add_subplot(1, 3, 2)
    ax.imshow(y)
    ax = fig.add_subplot(1, 3, 3)
    plt.imshow(result)

plt.figure(figsize=(12,8))
plt.plot(history.history['loss'])
plt.plot(history.history['val_loss'])
plt.legend(['Train_loss', 'Test_loss'])
plt.xlabel('Epoch')
plt.ylabel('Loss')
plt.show()